import React from "react";
import { useState } from "react";
const New = () => {
  const [priceValue, setPriceValue] = React.useState(30);

  return (
    <div
      style={{
        paddingTop: "60px",
        paddingBottom: "60px",
        display: "flex",
        justifyContent: "space-between",
      }}
    >
      <div
        style={{
          width: "50%",
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
        }}
      >
        <div
          style={{
            width: "60%",
            alignItems: "center",
            display: "flex",
            fontSize: "26px",
          }}
        >
          <h1>
            <span style={{ color: "red" }}>Airbnb it.</span> You could earn
          </h1>
        </div>

        <div style={{display:"flex",alignItems:""}}>
          <label htmlFor="destination" className="opacity-70 block">
            <div>
              <p style={{ fontSize: "60px" }}>{priceValue}</p>
            </div>
          </label>
          <div>
            <input
              type="range"
              name="destination"
              id="destination"
              min="150"
              max="1000"
              value={priceValue}
              step="10"
              onChange={(e) => setPriceValue(e.target.value)}
              style={{
                width: "262%", // Adjust width as needed
                margin: "10px 0", // Adjust margin as needed
                // Add any other inline styles as needed
              }}
            />
          </div>
        </div>
      </div>
      <div style={{ width: "50%" }}>
        <iframe
          src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d242117.70906659198!2d73.69815111553402!3d18.524870612981903!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3bc2bf2e67461101%3A0x828d43bf9d9ee343!2sPune%2C%20Maharashtra!5e0!3m2!1sen!2sin!4v1716360540118!5m2!1sen!2sin"
          width="600"
          height="450"
          style={{ border: "0" }}
          allowfullscreen=""
          loading="lazy"
          referrerpolicy="no-referrer-when-downgrade"
        ></iframe>
      </div>
    </div>
  );
};

export default New;
